import React from 'react';

import './AboutMe.css';

const AboutMe = () => {
    return (
        <div className="aboutme">
            <img id="selfie" src="IMG_2073.jpg" alt="Author Portrait"></img>
            <p className="bio"> Ashleigh has made a career of always building. In the past she worked with zero energy and green friendly design firms to bring physical construction on par with the technologies and methods now available. She has shifted her focus, and now builds in a new way as a web developer. She brings her passion for solving problems and designing and creating new projects, from concept to reality.<br></br>
            </p>

        </div>
    );
};

export default AboutMe;
